import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Home from './pages/Home';
import HomePaziente from './pages/HomePaziente';
import ListaMedicine from './pages/ListaMedicine';
import Medicina from './pages/Medicina';
import MessaggiPaziente from './pages/MessaggiPaziente';
import PromozioniFarmacia from './pages/PromozioniFarmacia';
import LoginPaziente from'./pages/LoginPaziente';
export default function App() {
  return (
    <Router>
      <Switch>
        <Route path="/ListaMedicine">
          <ListaMedicine />
        </Route>
        <Route path="/PromozioniFarmacia">
          <PromozioniFarmacia />
        </Route>
        <Route path="/MessaggiPaziente">
          <MessaggiPaziente />
        </Route>
        <Route path="/HomePaziente">
          <HomePaziente />
        </Route>
        <Route path="/Medicina">
          <Medicina />
        </Route>
        <Route path="/LoginPaziente" component={LoginPaziente} />
        <Route path="/">
          <Home/>
        </Route>
      </Switch>
    </Router>
  );
}
